export class Email {
    constructor(id, fromEmailName, emailAddressId, toEmailAddress, subject, body, status) {
        this.id = id;
        this.fromEmailName = fromEmailName;
        this.emailAddressId = emailAddressId;
        this.toEmailAddress = toEmailAddress;
        this.subject = subject;
        this.body = body;
        this.status = status;
    }
    static fromJSON(data) {
        return new Email(data.id, data.from_email_name, data.email_address_id, data.to_email_address, data.subject, data.body, data.status);
    }
}
